	this.frame_19 = function() {
		/* Animate Vertically
		Moves the symbol instance vertically on the stage by decreasing or increasing its y property within an Tick event.
		
		Instructions:
		1. The default direction of the animation is down.
		2. To change the direction of the animation to up, change the number 10 below to a negative value.
		3. To change the speed at which the symbol instance moves, change the number 10 below to the number of pixels you want the symbol instance to move in each frame.
		4. Because the animation uses an Tick event, it progresses only when the playhead moves to a new frame. The speed of the animation is also affected by the document frame rate.
		*/
		this.stop();
		stage.enableMouseOver();
		let root = this;
		let score = 0;
		this.score.text = score;
		let myPeanuts = [this.peanut1, this.peanut2, this.peanut3, 
		this.peanut4, this.peanut5, this.peanut6];
		let myNuts = [this.nut1, this.nut2, this.nut3, 
		this.nut4, this.nut5, this.nut6];
		
		//start game
		function init()
		{
			root.success.visible = false;
			root.next.visible = false;
			root.failed.visible = false;
			root.tryAgain.visible = false;
			for(let k=0; k<myPeanuts.length; k++)
			{
				myNuts[k].visible = false;
			}
		
		}
		init();
		
		//reset to initial position
		function peanutReset()
		{
			let myX1 = 300;
			let myX2 = 480;
			
			myPeanuts[0].x = myX1;
			myPeanuts[0].y = -60;
			myNuts[0].x = myX1;
			myNuts[0].y = -60;
			
			myPeanuts[2].x = myX1;
			myPeanuts[2].y = -305;
			myNuts[2].x = myX1;
			myNuts[2].y = -305;
			
			myPeanuts[4].x = myX1;
			myPeanuts[4].y = -580;
			myNuts[4].x = myX1;
			myNuts[4].y = -580;
			
			myPeanuts[1].x = myX2;
			myPeanuts[1].y = -190;
			myNuts[1].x = myX2;
			myNuts[1].y = -190;
			
			myPeanuts[3].x = myX2;
			myPeanuts[3].y = -450;
			myNuts[3].x = myX2;
			myNuts[3].y = -450;
			
			myPeanuts[5].x = myX2;
			myPeanuts[5].y = -710;
			myNuts[5].x = myX2;
			myNuts[5].y = -710;
		
		}
		
		//vertical animation of peanut falling
		this.addEventListener("tick", peanutFall.bind(this));
		function peanutFall()
		{
			//this.peanut1.y+=10;
			for(let i=0; i<myPeanuts.length; i++){
				myPeanuts[i].y+=10;
				myNuts[i].y+=10;
			}
			SucOrFail();
		}
		
		for(let j=0; j<myPeanuts.length;j++)
		{
			myPeanuts[j].addEventListener("mouseover", function (){
				myPeanuts[j].visible = false;
				myNuts[j].visible = true;
				score++;
				root.score.text = score;
			})
		}
		
		//check if success of fail
		function SucOrFail()
		{
			if(myPeanuts[5].y>500){
				if(score == myPeanuts.length){
					root.success.visible = true;
					root.next.visible = true;
				} else {
					root.failed.visible = true;
					root.tryAgain.visible = true;
				}
			}
		}
		
		//next button
		this.next.addEventListener("click", fl_ClickToGoToAndStopAtFrame.bind(this));
		function fl_ClickToGoToAndStopAtFrame()
		{
			var frameNumber = this.currentFrame;
			this.gotoAndStop(frameNumber);
		}
		
		//try again button
		this.tryAgain.addEventListener("click", tryAgain.bind(this));
		function tryAgain()
		{
			score = 0;
			root.score.text = score;
			init();
			peanutReset();
			
			for(let k=0; k<myPeanuts.length; k++)
			{
				myPeanuts[k].visible = true;
				myNuts[k].visible = false;
			}
		}
	}
